// iframe.service.ts
import { Injectable } from '@angular/core';
import { Router } from '@angular/router';

@Injectable({
  providedIn: 'root',
})
export class IframeService {
  constructor(private router: Router) {}

  updateIframeSrc(url: string) {
    this.router.navigateByUrl(`#${url}`);
  }
}
